    data: |
      SELECT DISTINCT - + cor0.col0 + col1 + col1 * ( col0 + - cor0.col2 ) AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q5196.out
    data: |
      -1303
      -275
      16
